script: |
  super -f text -I q8543.spq | sort > q8543.out

inputs:
  - name: q8543.spq
    data: |
      SELECT DISTINCT + COUNT ( + col1 ) AS col0, COUNT ( * ) AS col2 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT + ( + - 55 ) IS NULL;
  - name: tab1

outputs:
  - name: q8543.out
    data: |
      3	3
